import { useState } from 'react'
import styles from './SelectedPaper.module.css'

function SelectedPaperTitle() {
    return <h1 className={styles.selectedPaperTitle}>Selected Paper Title</h1>
}

function SelectedPaperSeparator() {
    return <div className={styles.selectedPaperSeparator}></div>
}

function AuthorsTableRow(props) {
    return (
        <tr className={styles.authorsTableRow}>
            <td className={styles.authorId}>
                {props.authorId}
            </td>
            <td className={styles.authorName}>
                {props.authorName}
            </td>
        </tr>
    );
}

function SelectedPaperAuthorsTable() {
    const authors = [
        {id: 1, name: "Name of the first author"},
        {id: 2, name: "Second author's name"},
        {id: 3, name: "Third author's name"},
        {id: 4, name: "Name of the fourth author"},
    ];

    return (
        <table id="authors" className={styles.dataTable}>
            <tr>
                <th className={styles.tableHeader}>Author ID</th>
                <th className={styles.tableHeader}>Name</th>
            </tr>
            {authors.map(author => <AuthorsTableRow key={author.id} authorId={author.id} authorName={author.name} />)}
        </table>
    );
}

function SelectedPaperMainDetails() {
    return (
        <form className={styles.mainDetails}>
            <div className={styles.pair}>
                <label for="title" className={styles.detailsLabel}>
                    Title
                </label>
                <input className={styles.detailsInput} id="title" type="text" value="Paper title" readOnly />
            </div>
            <div className={styles.pair}>
                <label for="abstract" className={styles.detailsLabel}>
                    Abstract
                </label>
                <input className={styles.detailsInput} id="abstract" type="text" value="Paper abstract" readOnly />
            </div>
            <div className={styles.pair}>
                <label for="topics" className={styles.detailsLabel}>
                    Topics
                </label>
                <input className={styles.detailsInput} id="topics" type="text" value="Topics related to the paper" readOnly />
            </div>
            <div className={styles.pair}>
                <label for="authors" className={styles.detailsLabel}>
                    Authors
                </label>
                <SelectedPaperAuthorsTable />
            </div>
        </form>
    );
}

function PaperCommentsRow(props) {
    return (
        <tr>
            <td className={styles.reviewerId}>{props.reviewerId}</td>
            <td className={styles.description}>{props.commentDescription}</td>
        </tr>
    );
}

function SelectedPaperCommentsTable() {
    const comments = [
        {id: 1, description: "........................"},
        {id: 2, description: "........................"},
        {id: 3, description: "........................"},
        {id: 4, description: "........................"},
        {id: 5, description: "........................"},
        {id: 6, description: "........................"},
    ];


    return (
        <table className={styles.dataTable}>
            <tr>
                <th className={styles.tableHeader}>Reviewer ID</th>
                <th className={styles.tableHeader}>Description</th>
            </tr>
            {comments.map(comment => <PaperCommentsRow key={comment.id} reviewerId={comment.id} commentDescription={comment.description} />)}
        </table>
    );
}

function SelectedPaperComments() {
    return (
        <div className={styles.paperComments}>
            <p className={styles.commentsLabel}>Comments</p>
            <SelectedPaperCommentsTable />
        </div>
    );
}

function SelectedPaperContent() {
    return (
        <div className={styles.selectedPaperContent}>
            <SelectedPaperMainDetails />
            <SelectedPaperComments />
        </div>
    );
}

function PaperDetailsPage() {
    return (
        <div className={styles.paperDetailsDiv}>
            <SelectedPaperTitle />
            <SelectedPaperSeparator />
            <SelectedPaperContent />
        </div>
    );
}

export { PaperDetailsPage }
